import React from "react";

export default function DoctorCard(/*props*/)
{
    let divStyle = {
        maxWidth: "fit-content",  //Revise this property
        maxHeight: "max-content", //Revise this property
        backgroundColor: "rgb(0,222,222,0.5)",
        alignItems: "center",
        textAlign: "center",
        padding: "15px",
        borderRadius: "5px",
        color: "darkslategrey",
        boxShadow: "10px 10px rgb(111,111,111,.2)",
    }
    let imgStyle = {
        border: "double",
        borderRadius: "5px",
        boxShadow: "5px 5px rgb(111,111,111,.2)",
    }
    let textStyle = {
        textShadow: "3px 3px rgb(111,111,111,.2)",
        // textDecoration: "underline",
        textDecoration: "none",
        color: "darkslategrey",
    }
       return (
        <div style={divStyle}>
            <img style = {imgStyle} src= "./image3.jpg"/>
            <h3 style = {textStyle}>Deepak Kumar Saini</h3>
            <p style = {textStyle}>Orthosajfdgj</p>
            <p style={textStyle}>Phone: +91-70878-75143 </p>
            <p style = {textStyle}>Email: Kumarsainideepak32@gmail.com</p>
            <div>
                Blog Links: 
                <a style={textStyle} href = "">Corona Precautions</a>
            </div>
        </div>
    )
}



